import { container, title } from "../../assets/jss/material-kit-react.js";
import {containerFluid} from "../../assets/jss/material-kit-react";

const createMnemonicStyle = {
    container: {
        ...container,
        marginTop:"100px",
        marginLeft:"28px",
        color: "#FFFFFF",
    },

    box_container: {
        ...containerFluid,
        "@media (min-width: 576px)": {
            maxWidth: "540px",
        },
        "@media (min-width: 768px)": {
            maxWidth: "720px",
        },
        "@media (min-width: 992px)": {
            maxWidth: "960px",
        },
        "@media (min-width: 1200px)": {
            maxWidth: "1140px",
        },
    },
};

export default createMnemonicStyle;
